import React, { Component } from 'react'

export default class Head extends Component {
    render() {
        return (
            <div>
                <Header className="head">订票系统运维平台
                <span style={{ marginLeft: '800px', fontSize: '15px' }}>张三
                <span to="/a" style={{ marginLeft: '20px' }}>退出登录</span></span></Header>
            </div>
        )
    }
}
